  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study is to give a
  general discussion of the aquatic environment and collect qualitative data of the
  life in a lentic site, a small pond in the Erie National Wildlife Refuge. The general
  plan for collecting data was to obtain qualitative data on what life existed in
  the pond and what depended on the pond. It also included physical and chemical aspects
  of the pond.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
